import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

export default function Items() {
  const { itemID } = useParams();

  const [itemInfo, setItemInfo] = useState({
    id: "null",
    itemName: "null",
    itemPrice: "null",
    description: "null",
    category: "null",
    postTime: "null",
    editTime: "null",
    visitCount: 1,
    searchCount: 1,
    photo1Name: null,
    photo2Name: null,
    photo3Name: null,
    status: "available",
  });

  useEffect(() => {});
  return <div>Items of {itemID}</div>;
}
